INSERT INTO `membres` VALUES ('39', 'Marie Alphonsine', NULL, 'NAVET', 'F', '1851-04-16', '(Tourlaville) Cherbourg-en-Cotentin, Manche, Normandie, France', NULL, '1940-06-26', '(Cherbourg) Cherbourg-en-Cotentin, Manche, Normandie, France', NULL, 'Cuisinière', 'Il est écrit dans le testament d\'Emmanuel Liais:\r\n\"A chacune des personnes que M. Liais employait comme jardiniers ou concierges, une indemnité d\'une année de leurs gages et de la valeur d\'une année de leur loyer. [suivent les noms de ces personnes]\r\nMadame Marie Alphonsine Navet \"veuve de M. Auguste Désiré Durel, demeurant à Cherbourg, dont les gages et indemnités de loyer s\'élevaient à 720 francs\".\r\nPar ailleurs, cette dame a fait une chute le 26 mai 1906 : \"Mme Durel femme de peine au parc Emmanuel Liais, a été blessée dernièrement dans son service: elle s\'est démis l\'épaule en faisant une chute dans une allée du parc, alors qu\'elle se précipitait pour ouvrir une porte à des ouvriers\".\r\nElle fut soignée par le docteur Delisle qui ofriciait rue Bonhomme. Apparemment, elle se remis bien de sa blessure et repris le travail un mois après.\r\n------------------------------------------\r\nL\'ancienne tombe Cécile Durel / Marie Navet a été refaite en 1999 au décès de Raymond et Paulette Durel.\r\nLe nom de Marie Navet a malheureusement était omis sur la nouvelle sépulture.\r\nElle a d\'abord été inhumée en zone commune puis exhumée le 26 Mars 1945 et inhumée de nouveau avec son arrière petite fille Cécile Durel.');
