INSERT INTO `membres` VALUES ('7961', 'Enfant-Sans-Vie', NULL, 'NAVET', 'U', '1841-12-02', 'Martinvast, Manche, Normandie, France', NULL, '1841-12-02', 'Martinvast, Manche, Normandie, France', NULL, '', '');
INSERT INTO `membres` VALUES ('7962', 'Pierre Dominique', '', 'NAVET', 'M', '1771-01-08', 'Morville, Manche, Normandie, France', 'Baptême p.96 (droite)\r\nhttps://www.archives-manche.fr/ark:57115/s005e5e738660065/5e5e73882645c.fiche=arko_fiche_65772df6cdf37.moteur=arko_default_635b873d1f4a7\r\nLe mercredy 9 de janvier de l\'an 1771, a été baptisé par moy curé de la parroisse de Morville Pierre Dominique né du jour d\'hier du légitime mariage de Pierre NAVET maçon et de Françoise VALQUIER son épouse de cette parroisse. Le parrain Leonard Denys André HALLOT laboureur de cette parroisse, marraine Marie Françoise NAVET aussi de cette parroisse qui ont signé avec nous. Le père absent. - HALLOT - Marie NAVET - LAUNEY prbre', '1847-05-14', 'Morville, Manche, Normandie, France', 'Décès p.86 (droite)\r\nhttps://www.archives-manche.fr/ark:57115/s005e5e841810f81/5e5e84199d5e1.fiche=arko_fiche_65772df3a1c84.moteur=arko_default_635b873d1f4a7\r\nL\'an 1847 le 15e jour du mois de mai 11h du matin par devant nous BERNAR Siméon Joseph maire de Morville ... sont comparus en notre maison commune BIHEL Louis charpentier âgé de 51 ans et BURNOUF Jean cordonnier âgé de 51 ans tous 2 domiciliés dans la présente commune voisins du défunt lesquels nous ont déclaré que le 14e jour du mois de mai à 8h du matin NAVET Pierre Dominique âgé de 76 ans né à Morville, sans profession domicilié dans la présente commune, veuf de Marie Françoise ADAM est décédé en cette commune dans sa maison triage du Poiret ainsi que nous nous en sommes assuré et que les déclarants ont signé avec nous le présent acte de décès après que lecture leur en a été faite. - LE BIHEL - Jean BURNOUF - S BESNARD', '', '');
INSERT INTO `membres` VALUES ('7963', 'Marie Françoise Catherine', '', 'ADAM', 'F', '1771-11-21', 'Brix, Manche, Normandie, France', 'Naissance: p.47, 48\r\nhttps://www.archives-manche.fr/ark:57115/s005e5f4b5b47b6c/5e5f4b5bdadf8.fiche=arko_fiche_657723d544a58.moteur=arko_default_635b873d1f4a7\r\nLe 21 novembre année 1771 une fille née daujourdhui du légitime mariage de Christhophe Etienne ADAM cordonnier et de Marie Françoise LEVAUFRE de cette paroisse a été baptisée par moi prêtre de ce lieu soussigné et a été nommée Marie Françoise Catherine par Anne Marie HIRARD assistée de François HIRARD son père tous 2 de cette paroisse soussignés et marqués. - la marque de laditte marainne - F HIRARD - HAMEL prêtre', '1844-03-20', 'Morville, Manche, Normandie, France', 'Décès: p.25, 26\r\nhttps://www.archives-manche.fr/ark:57115/s005e5e841810f81/5e5e84186ae1e.fiche=arko_fiche_65772df3a1c84.moteur=arko_default_635b873d1f4a7\r\nL\'an 1844 le 23e jour de mars à 9h du matin par devant nous BESNARD Siméon Joseph maire de Morville ... sont comparus DESMARES Louis âgé de 47 ans cultivateur domicilié à Morville et BIHEL Louis âgé de 51 ans garde-champêtre domicilié à Morville lesquels nous ont déclaré que le 20 du mois de mars à 1h d\'après-midi Marie Caroline Françoise ADAM âgée de 72 ans née en la commune de Brix femme de Pierre NAVET est décédée en cette commune en sa maison, ainsi que nous nous en sommes assuré et les déclarants ont signé avec nous le présent acte après que lecture leur en a été faite. - Louis DESMARES - LEBIHEL - S BESNARD.', '', 'Il y a une différence sur les prénoms de l\'acte de décès: Marie-Françoise Catherine → Marie-Françoise Caroline. ');
