INSERT INTO `membres` VALUES ('7968', 'Marie-Françoise', NULL, 'VALQUIER', 'F', '1736-05-22', '(Bricquebec) Bricquebec-en-Cotentin, Manche, Normandie, France', NULL, '1810-07-10', 'Morville, Manche, Normandie, France', NULL, 'Fileuse', 'BAPTÊME 5 Mi 1900 - 1736-1739 p13\r\nhttps://www.archives-manche.fr/ark:57115/s005e5d71ce0b6be/5e5d71ce620a1.fiche=arko_fiche_657723c2df785.moteur=arko_default_635b873d1f4a7\r\nMarie Françoise VALQUIER fille de Jean Thomas et de Marie DOREY née en légitime mariage nommée et tenue sur les fonds de baptême par la femme de Jacques Georges VEEL assistée de son mari, a été baptisée par moi prêtre vicaire de Bricquebec ce 22 de may 1736 assisté du parrain et de la marraine.\r\nDÉCÈS 5 Mi 602 1802-1812 p135\r\nhttps://www.archives-manche.fr/ark:57115/s005e5ed601bbe58/5e5ed60404050.fiche=arko_fiche_65772df38d939.moteur=arko_default_635b873d1f4a7\r\nL\'an 1810 le 11 du mois de juillet par devant nous Charles Louis NAVET maire de Morville...sont comparus les personnes de Pierre Dominique NAVET âgé de 39 ans, journalier de ladite commune et Louis Thomas MESLIN âgé de 24 ans domicilié à Morville lesquels m\'ont déclaré que Françoise VALQUIER, âgée de 78 ans, Vve de feu Pierre NAVET ancien maçon de Morville, fille de feu Jean Thomas VALQUIER et de feue Marie DOREY domiciliée à Bricquebec, lesquels nous ont déclaré que ladite Françoise VALQUIER est décédée d\'hier à son domicile sur les 11h du matin profession de fileuse d\'après cette déclaration des témoins ci-dessus dénommés j\'ai constaté le décès et les ci-dessus témoins ont signé avec moi l\'acte de décès audit jour et an ci-dessus daté\r\nIl existe une incohérence entre l\'âge inscrit sur l\'acte de décès (78 ans) et l\'année de naissance.');
INSERT INTO `membres` VALUES ('7969', 'Pierre', '', 'NAVET', 'M', '1731-01-31', 'Morville, Manche, Normandie, France', 'Naissance : p.53/126\r\nhttps://www.archives-manche.fr/ark:57115/s005e62b0cd769ee/5e62b0ce201ee.fiche=arko_fiche_65772df6c66ff.moteur=arko_default_635b873d1f4a7\r\nCe 31 janvier 1731 a été baptisé par nous prêtre curé pour la 1ère portion un fils né du jour d\'hier du légitime mariage de Jean Charles NAVET et de Marie Suzanne DELACOTTE son épouse, nommé par Pierre NAVET assisté de Jeanne Françoise LAY son épouse.', '1802-11-07', 'Morville, Manche, Normandie, France', 'Décès : p.15/170\r\nhttps://www.archives-manche.fr/ark:57115/s005e5ed601bbe58/5e5ed6021a56a.fiche=arko_fiche_65772df38d939.moteur=arko_default_635b873d1f4a7\r\nDu 17 jour du mois de brumaire l\'an 11 acte de décès de Pierre NAVET décédé le 16 du présent à 3h du soir, journalier âgé de 68 ans né à Morville fils de feu Jean Charles NAVET sur la déclaration à moi faite par le citoyen Jean NAVET demeurant à Morville, cultivateur qui a dit être cousin du défunt et par le citoyen Charles BURNOUF demeurant à Morvile, cultivateur voisin du défunt et ont signé, constaté par moi Jacques NAVET adjoint du maire de Morville soussigné.', 'Journalier', '');
