INSERT INTO `membres` VALUES ('8005', 'Philippe Gabriel', NULL, 'TRAVERT', 'M', '1773-12-10', 'Négreville, Manche, Normandie, France', NULL, '1866-03-17', 'Négreville, Manche, Normandie, France', NULL, 'Meunier', 'Décédé au domicile de la Marquise d\'Héricy lieu dit Pont-Rilly à Négreville.\r\nIl doit s\'agir d\'Ambroisine-Marie de La Houssaye (1780-1870) Marquise d\'Héricy.\r\nElle était également la maîtresse d\'Honoré V de Monaco et probablement l\'aïeule des Grimaldi actuels.');
