INSERT INTO `mariages` VALUES ('204', '7962', '7963', '1799-06-28', '(Sauxemesnil) Saussemesnil, Manche, Normandie, France', '0000-00-00', '', '1', 'Mariage p.129\r\nhttps://www.archives-manche.fr/ark:57115/s005e5fe8f99fd1b/5e5fe8ff8f5c0.fiche=arko_fiche_6577320becc90.moteur=arko_default_635b873d1f4a7\r\nAujourd\'hui 10 Messidor an VII de la République Française par devant moi Martin BERTEAULT président de lad. mairie de Saussemesnil sont comparus dans ce local ... les citoyens Pierre Dominique NAVET né à Morville le 8/1/1771 fils de Pierre NAVET et de Françoise VALQUIER demeurant à Morville d\'une part et Marie Françoise Catherine ADAM née à Brix, y demeurant fille de Christophe Etienne ADAM et de Marie Françoise LEVAUFRE d\'autre part, lesquels futurs m\'ont requis de les unir en mariage. Présence de Marie LEPRIEUR, Jean JOURDAN, Louise JOURDAN et Christophe PESNEL tous témoins majeurs domiciliés dans le canton....Les publications faites tant à la porte de la maison commune de ce canton qu\'en celui de Bricquebec ... J\'ai prononcé au nom de la loi que ledit Pierre Dominique NAVET et Marie Françoise Catherine ADAM sont unis en mariage et j\'ai rédigé le présent acte ... Fait au local destiné à la Réunion des citoyens ledit jour et an. La dite Marie Françoise Catherine ADAM a déclaré ne savoir signer. - Pierre NAVET - Marie LEPRIEUR - Louise JOURDAN - J JOURDAN - C PESNEL - M BERTHEAULT');
