INSERT INTO `mariages` VALUES ('208', '7969', '7968', '1761-01-13', 'Morville, Manche, Normandie, France', '0000-00-00', '', '1', 'Mariage : p.3 gauche\r\nhttps://www.archives-manche.fr/ark:57115/s005e5e738660065/5e5e7386793dc.fiche=arko_fiche_65772df6cdf37.moteur=arko_default_635b873d1f4a7\r\nCe mardy 13e jour dudit mois dudit an 1761 après les publications des bans du futur mariage entre Pierre NAVET fils majeur de Jean Charles NAVET et de Marie DELACOTTE de cette paroisse d\'une part et entre Marie Françoise VALQUIER fille majeure de Jean Thomas VALQUIER journalier et de Marie Louise DOREY de la paroisse de Bricquebec d\'autre part faits aux prônes des messes paroissiales tant en cette paroisse qu\'en celle de Bricquebec.... je soussigné curé de Morville pour la 1ère portion... après les fiançailles célébrées à Bricquebec ai reçu ce jour en cette église leur mutuel consentement de mariage et leur ay donné la bénédiction nuptiale en présence des soussignés parents et témoins qui ont signé avec les époux');
