INSERT INTO `documents` VALUES ('48', '17', 'photo', 'document', 'Acte de naissance', NULL, 'Acte de naissance Thérèse Hébert', 'Acte-de-naissance-Thérèse-Hébert.jpg', 'uploads/photos/photo_6938cae77b81b_1765329639.jpg', '275591', '2025-12-10 02:20:39', '2025-12-15 10:56:56');
INSERT INTO `documents` VALUES ('78', '7990', 'note', 'document', 'Bio Raymond Villey-Desmeserets', 'Issu d\'une famille de notables normands. Son grand-père paternel, Edmond Villey (1848-1924), économiste, fondateur de la Revue d\'économie politique, a été doyen de la faculté de droit de Caen. Son grand-père maternel est le philosophe Émile Boutroux (1845-1921). Son père, Pierre Villey (1879-1933), bien qu\'aveugle, a été professeur à la faculté des lettres de Caen, spécialiste de la littérature française du XVIe siècle. Son oncle Jean Villey (1885-1948), physicien, a été professeur à la faculté des sciences de Paris, et un autre oncle, Achille Villey-Desmeserets (1878-1955), préfet de la Seine de 1934 à 1940. Son frère aîné Daniel Villey (1910-1968) a été professeur d\'économie politique à Poitiers et à Paris et son cadet, Michel Villey (1914-1988), professeur de droit à Paris, spécialiste de la philosophie du droit.', 'Famille intellectuelle normande, économistes, philosophes, juristes, professeurs.', NULL, NULL, NULL, '2025-12-10 22:42:10', '2025-12-10 22:42:10');
INSERT INTO `documents` VALUES ('79', '7990', 'note', 'document', 'Raymond Henri Joseph Villey-Desmeserets', 'https://fr.wikipedia.org/wiki/Raymond_Villey', 'Page Wikipédia', NULL, NULL, NULL, '2025-12-10 22:47:16', '2025-12-10 22:47:16');
